export const dohPriceList: MarketItem[] = rawData.map(item => {
    const calculatedPrice = parseFloat((item.median * 1.15).toFixed(2));
    return {
        id: 20000 + item.id,
        itemCode: `MED-${String(20000 + item.id).padStart(5, '0')}`,
        name: item.name,
        description: item.name,
        category: "Drugs and Medicine",
        uacsCode: "50203070-00", // Medical, Dental and Laboratory Supplies
        quantity: 1000, // Default quantity
        unit: item.unit,
        price: calculatedPrice,
        referenceLinks: []
    };
});